import React, { useState } from 'react';

function BookServices() {
  const [date, setDate] = useState('');
  const [time, setTime] = useState('');
  const [duration, setDuration] = useState('');
  const [carType, setCarType] = useState('');
  const [location, setLocation] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    const booking = { date, time, duration, carType, location };
    console.log(booking);
    // Send the booking data to a backend API or perform any other necessary actions here
  };

  return (
    <div>
      <h1>Book Services</h1>
      <form onSubmit={handleSubmit}>
        <label htmlFor="date">Date:</label>
        <input type="date" id="date" value={date} onChange={(e) => setDate(e.target.value)} />

        <label htmlFor="time">Time:</label>
        <input type="time" id="time" value={time} onChange={(e) => setTime(e.target.value)} />

        <label htmlFor="duration">Duration:</label>
        <input type="text" id="duration" value={duration} onChange={(e) => setDuration(e.target.value)} />

        <label htmlFor="carType">Car Type:</label>
        <input type="text" id="carType" value={carType} onChange={(e) => setCarType(e.target.value)} />

        <label htmlFor="location">Location:</label>
        <input type="text" id="location" value={location} onChange={(e) => setLocation(e.target.value)} />

        <button type="submit">Book Parking</button>
      </form>
    </div>
  );
}
export default BookServices
